import React from "react";
import styled from "styled-components";

const Container = styled.div``;

const CoinList = styled.ul``;

const Coin = styled.li``;

const Header = styled.header``;

const Title = styled.h1`
  color: ${(props) => props.theme.accentColor};
`;

const coins = [
    {
        "id": "btc-bitcoin",
        "name": "Bitcoin",
        "symbol": "BTC",
        "rank": 1,
        "is_new": false,
        "is_active": true,
        "type": "coin"
      },
      {
        "id": "eth-ethereum",
        "name": "Ethereum",
        "symbol": "ETH",
        "rank": 2,
        "is_new": false,
        "is_active": true,
        "type": "coin"
      },
      {
        "id": "usdt-tether",
        "name": "Tether",
        "symbol": "USDT",
        "rank": 3,
        "is_new": false,
        "is_active": true,
        "type": "token"
      },
    ]

function Coins() {
  return (
    <Container>
      <Header>
        <Title>코인</Title>
      </Header>
      <CoinList>
      {coins.map(coin=><Coin key={coin.id}>{coin.name}</Coin>)}  
      </CoinList>
    </Container>
  );
}

export default Coins;
